const Dashboard2 = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1>Welcome to Dashboard 2!</h1>
      <p>This is the dashboard for user2@example.com.</p>
    </div>
  );
};

export default Dashboard2;
